import React, { useState } from 'react'; 
import './Messages.css';
import Navbar from './Navbar';

export default function Messages({ role }) {
    return (
        <div className='container'>
            <Navbar role={role} />
            <h1>Messages</h1>
            <form>
                <div>
                    <input type="text"/>
                    <button type="submit">Send</button>
                </div>
            </form>
            <button>Back</button>
        </div>
    );
}
